(187, 'Nhiều người trở thành nhà quản lý một cách ngẫu nhiên. Khi họ làm việc tốt, có nhiều kinh nghiệm, được thăng tiến hay do yêu cầu công việc, họ cảm thấy mình có trách nhiệm với công việc của những người xung quanh. Khi đó, chính họ phải tìm kiếm, tuyển dụng và bổ nhiệm những người mà năng lực làm việc sẽ ảnh hưởng trực tiếp đến công việc của người tuyển dụng.Thu nhập và cơ hội thăng tiến của người quản lý lúc đó lại phụ thuộc vào khả năng làm việc của những người mà họ đã tuyển. Việc lựa chọn và giữ chân những nhân viên giỏi không phải là một việc có thể học được nhờ giáo trình và những khóa đào tạo. Công việc này đòi hỏi cả một nghệ thuật cùng với những kỹ năng cần thiết mà chúng ta chỉ có thể có được từ những trải nghiệm thực tế. Chúng ta thường xem việc tìm người để lấp vào vị trí còn trống là một vấn đề phải giải quyết càng sớm càng tốt để chúng ta có thời gian tập trung vào công việc của mình. Thế nhưng, chính chúng ta đã quên một điều rằng lựa chọn đúng người cho vị trí đó mới là việc quan trọng nhất mà chúng ta cần phải làm.22 bí quyết trong cuốn sách này sẽ giúp bạn có cái nhìn mới trong việc tuyển dụng và đãi ngộ những người tài giỏi. Chỉ sau một giờ đọc sách, bạn sẽ nắm được những nguyên tắc quan trọng nhất trong việc chiêu mộ và giữ chân nhân viên mà những nhà quản lý hàng đầu trong các công ty danh tiếng vẫn thường áp dụng.', '117.0.196.54', 'Mozilla/5.0 (Windows NT 10.0; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/116.0.0.0 Safari/537.36', '794223503344', '', '2023-09-17 18:16:26', 0, 'Guest', NULL, 1, 'Hanoi'),
